import './App.css';
import Header from './components/SearchBar/Header/Header';
import SearchBar from './components/SearchBar/SearchBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <SearchBar/>
      </header>
    </div>
  );
}

export default App;
